import React from "react";
//import {Drawer} from "@material-ui/core";


const ListDropdown = (props) => {
    return(
        <div style={{ width: "10px", height: "4px", border:'1px solid red' }}  open={props.open}>

        </div>

    );

};

export default ListDropdown;
